            <p>
            Hi there, it's Sarah and Quin from Bluey & Co., a community-inspired cafe featuring Asian beverages and desserts with a nostalgic twist. Bluey & Co. is not just about the food and drinks. We offer the sense of community, the laughter, and the meaningful connections, over a cup of coffee. Come by to our pop-up cafe for <b>good coffee and better company!</b>
            </p>
